import { CourseDescriptionPart, CourseNormalPart, CoursePartBase, CourseProjectPart, CourseSubmissionPart } from "../types";
import Part from "./Part";

const Content = ({courseParts}: {courseParts: Array<CoursePartBase | CourseNormalPart |CourseDescriptionPart | CourseProjectPart | CourseSubmissionPart>}) => {
    return(
        <>
        {
            courseParts.map(c => (
                <div key={c.name}>
                    <p>{courseParts.name}</p>
                    <Part course={c}/>
                </div>
            ))
        }
        </>
    )
}

export default Content;
